import navUrl1 from '../../images/connent/icon_5.png';
import navUrl2 from '../../images/connent/icon_2.png';
import navUrl3 from '../../images/connent/icon_3.png';
import React from 'react';
import './home.scss';
import { Icon } from 'antd';
// var Highcharts = require('highcharts');
// 在 Highcharts 加载之后加载功能模块
// require('highcharts/modules/exporting')(Highcharts);


class Home extends React.Component {

  state = {
    cartList: [{
      title: '新增用户数',
      number: '10',
      icon: navUrl1
    }, {
      title: '累计访问',
      number: '11',
      icon: navUrl2
    }, {
      title: '分享统计',
      number: '12',
      icon: navUrl3
    }]
  };

  render() {
    return (
      <div className="home-warp">
        <div className="cart-list">
          {
            this.state.cartList.map((item) => {
              return (
                <div className="cart-item" key={item.title}>
                  <div className="cart-item-nav">
                    <img className="cart-item-img" src={ item.icon } />
                  </div>
                  <div className="cart-item-content">
                    <div className="number">{ item.number } /</div>
                    <div className="title">{ item.title }</div>
                  </div>
                </div>
              );
            })
          }
        </div>
        <div className="user-chart">
          <div id="user_origin"> </div>
          <div id="user_container"> </div>
        </div>
      </div>
    );
  }

  componentDidMount() {

  }

}

export default Home
